import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Navigation from './components/Navigation'

function App() {
  return (

    <div>
      <Navigation />

      <div className="App">



        <header className="App-header">
          <p>Hello, World</p>
        </header>
      </div>
    </div>


  );
}

export default App;
